import { makeStyles } from "@mui/material";

export default makeStyles({
  container: {
    padding: '121px 0',  
    background: 'linear-gradient(rgb(0, 0, 1) 2%, rgb(13 19 28) 21.57%, rgb(20 7 24) 65.85%,  rgb(13, 22, 34) 90.62%)',
